import SearchBarContainer from "./SearchBarContainer"
import NavigationBar from "./NavigationBar"
import "./core.css"


function StartingPage() {
    return (
      <div>
        <NavigationBar />
        <div id="startingPageHeader" className="jumbotron">Fly AI</div>
        <div id="startingPageMiddle" className="container-fluid">
          <SearchBarContainer />
        </div>
        <div id="startingPageLower" className="container-fluid"></div>

      </div>
    );
  }

  export default StartingPage;
